import React, { useState } from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import SearchBar from '../components/SearchBar';
import PropertyCard from '../components/PropertyCard';

const HeroSection = styled.section`
  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
  color: white;
  padding: 8rem 2rem 6rem;
  text-align: center;
  margin-top: 70px;
`;

const HeroTitle = styled.h1`
  font-size: 3.5rem;
  font-weight: 700;
  margin-bottom: 1rem;
  max-width: 800px;
  margin-left: auto;
  margin-right: auto;

  @media (max-width: 768px) {
    font-size: 2.5rem;
  }
`;

const HeroSubtitle = styled.p`
  font-size: 1.2rem;
  margin-bottom: 2rem;
  opacity: 0.9;
  max-width: 600px;
  margin-left: auto;
  margin-right: auto;
`;

const Section = styled.section`
  padding: 4rem 0;
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
`;

const PropertyGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
  margin-top: 2rem;
`;

const StatsSection = styled.section`
  background: #f8fafc;
  padding: 4rem 0;
`;

const StatsGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
  gap: 2rem;
  text-align: center;
`;

const StatCard = styled.div`
  background: white;
  padding: 2rem;
  border-radius: 12px;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.05);
`;

const StatNumber = styled.div`
  font-size: 3rem;
  font-weight: 700;
  color: #3b82f6;
  margin-bottom: 0.5rem;
`;

const StatLabel = styled.div`
  color: #64748b;
  font-weight: 500;
`;

// Sample property data
const featuredProperties = [
  {
    id: 1,
    title: "Modern Downtown Condo",
    location: "Downtown, Seattle",
    price: 750000,
    type: "sale",
    bedrooms: 2,
    bathrooms: 2,
    sqft: 1200,
    image: "https://images.unsplash.com/photo-1545324418-cc1a3fa10c00?w=400"
  },
  {
    id: 2,
    title: "Luxury Family Home",
    location: "Bellevue, WA",
    price: 1250000,
    type: "sale",
    bedrooms: 4,
    bathrooms: 3,
    sqft: 2800,
    image: "https://images.unsplash.com/photo-1570129477492-45c003edd2be?w=400"
  },
  {
    id: 3,
    title: "Cozy Studio Apartment",
    location: "Capitol Hill, Seattle",
    price: 2200,
    type: "rent",
    bedrooms: 1,
    bathrooms: 1,
    sqft: 600,
    image: "https://images.unsplash.com/photo-1522708323590-d24dbb6b0267?w=400"
  }
];

const Home = () => {
  const [searchResults, setSearchResults] = useState(featuredProperties);

  const handleSearch = (filters) => {
    // Simple filter logic - in a real app, this would be an API call
    let filtered = featuredProperties.filter(property => {
      if (filters.location && !property.location.toLowerCase().includes(filters.location.toLowerCase())) {
        return false;
      }
      if (filters.type && property.type !== filters.type) {
        return false;
      }
      if (filters.minPrice && property.price < parseInt(filters.minPrice)) {
        return false;
      }
      if (filters.maxPrice && property.price > parseInt(filters.maxPrice)) {
        return false;
      }
      if (filters.bedrooms && property.bedrooms < parseInt(filters.bedrooms)) {
        return false;
      }
      return true;
    });
    setSearchResults(filtered);
  };

  return (
    <div>
      <HeroSection>
        <Container>
          <HeroTitle>Find Your Dream Property</HeroTitle>
          <HeroSubtitle>
            Discover the perfect home with our extensive collection of premium properties
          </HeroSubtitle>
        </Container>
        <SearchBar onSearch={handleSearch} />
      </HeroSection>

      <Section>
        <Container>
          <h2 className="section-title">Featured Properties</h2>
          <p className="section-subtitle">
            Explore our handpicked selection of exceptional properties
          </p>
          <PropertyGrid>
            {searchResults.map(property => (
              <PropertyCard key={property.id} property={property} />
            ))}
          </PropertyGrid>
          <div style={{ textAlign: 'center', marginTop: '3rem' }}>
            <Link to="/listings" className="btn btn-primary" style={{ padding: '1rem 2rem', fontSize: '1.1rem' }}>
              View All Properties
            </Link>
          </div>
        </Container>
      </Section>

      <StatsSection>
        <Container>
          <h2 className="section-title">Why Choose Creative Listings</h2>
          <StatsGrid>
            <StatCard>
              <StatNumber>1000+</StatNumber>
              <StatLabel>Properties Listed</StatLabel>
            </StatCard>
            <StatCard>
              <StatNumber>500+</StatNumber>
              <StatLabel>Happy Clients</StatLabel>
            </StatCard>
            <StatCard>
              <StatNumber>15+</StatNumber>
              <StatLabel>Years Experience</StatLabel>
            </StatCard>
            <StatCard>
              <StatNumber>24/7</StatNumber>
              <StatLabel>Customer Support</StatLabel>
            </StatCard>
          </StatsGrid>
        </Container>
      </StatsSection>
    </div>
  );
};

export default Home;
